# 1 "Lexer.fsl"
 

module FSharp.Xml.Light.Lexer
open FSharp.Text.Lexing
open Dtd
open System.Collections.Generic
open Parser 

let lexeme  (lexbuf : LexBuffer<char>) = new System.String(lexbuf.Lexeme)
let lexeme_start<'a> (lexbuf : LexBuffer<'a>) = lexbuf.StartPos.AbsoluteOffset
let lexeme_end<'a> (lexbuf : LexBuffer<'a>) = lexbuf.EndPos.AbsoluteOffset
let lexeme_char<'a> (lexbuf  : LexBuffer<'a>) n = lexbuf.LexemeChar n

type error =
    | EUnterminatedComment
    | EUnterminatedString
    | EIdentExpected
    | ECloseExpected
    | ENodeExpected
    | EAttributeNameExpected
    | EAttributeValueExpected
    | EUnterminatedEntity

type dtd_error =
    | EInvalidDTDDecl
    | EInvalidDTDTag
    | EDTDItemExpected
    | EInvalidDTDElement
    | EInvalidDTDAttribute

exception Error of error * int
exception DTDError of dtd_error

type pos = int * int * int * int

type dtd_decl =
    | DTDFile of string
    | DTDData of dtd

type dtd_item_type =
    | TElement
    | TAttribute

type token =
    | Tag of string * (string * string) list * bool
    | PCData of string
    | Endtag of string
    | DocType of (string * dtd_decl)
    | Eof

let last_pos = ref 0
let current_line = ref 0
let current_line_start = ref 0

let tmp = Buffer.create 200


let entities = [
  "gt"  ,62, ">";
  "lt"  ,60, "<";
  "amp" ,38, "&";
  "apos",39, "'";
  "quot",34, "\"";
]

let idents = Dictionary<string,string>()
let _ = begin
  List.iter (fun (str,code,res) ->
      idents.Add((str+";"),res) ;
      if code > 0
      then idents.Add(("#" + (string code) + ";") ,res)
    ) entities
end

let init lexbuf =
    current_line := 1;
    current_line_start := lexeme_start lexbuf;
    last_pos := !current_line_start

let close lexbuf =
    Buffer.reset tmp

let pos lexbuf =
    !current_line ,    !current_line_start ,
    !last_pos ,
    lexeme_start lexbuf

let restore (cl,cls,lp,_) =
    current_line := cl;
    current_line_start := cls;
    last_pos := lp

let newline lexbuf =
    incr current_line;
    last_pos := lexeme_end lexbuf;
    current_line_start := !last_pos

let error lexbuf e =
    last_pos := lexeme_start lexbuf;
    raise (Error (e, !last_pos))

let dtd_error lexbuf e =
    last_pos := lexeme_start lexbuf;
    raise (DTDError e)

